import React, { useState } from 'react';
import { STR, WEEK_SLICES_LBL } from './constants';

const card = { background:'#fff', color:'#2c466b', borderRadius:10, padding:'10px 20px', margin:10, minWidth:80, textAlign:'center', fontWeight:'bold', boxShadow:'0 2px 8px rgba(0,0,0,0.1)'};

export default function AppFixed(){
  const [managerTab, setManagerTab] = useState('staff');
  const [showManager, setShowManager] = useState(true);
  const [showInfo, setShowInfo] = useState(null);
  const [currentSlice] = useState(0);

  const staffSlots = [
    { role: 'Asistan', filled: true, emoji: '*' },
    { role: 'Asistan', filled: false },
    { role: 'Fizyo', filled: true, emoji: '*' },
    { role: 'Fizyo', filled: false },
    { role: 'Antrenor', filled: true, emoji: '*' },
    { role: 'Antrenor', filled: true, emoji: '*' },
    { role: 'Antrenor', filled: false },
    { role: 'Antrenor', filled: false },
    { role: 'Scout', filled: true, emoji: '*' },
    { role: 'Scout', filled: true, emoji: '*' },
    { role: 'Scout', filled: false },
    { role: 'Scout', filled: false },
  ];

  const onStaffClick = (s) => {
    if (s.filled) return;
    const msg = s.role === 'Asistan'
      ? 'Amator kume seviyesinde maksimum 1 asistan atayabilirsin.'
      : (s.role === 'Antrenor'
          ? 'Amator kume seviyesinde maksimum 2 antrenor atayabilirsin.'
          : 'Mevcut seviyede ek slot yok.');
    setShowInfo({ title: 'Uyari', message: msg });
  };

  return (
    <div style={{minHeight:'100vh', background:'#2c466b', color:'#fff', padding:20, fontFamily:'sans-serif'}}>
      <div style={{display:'flex', gap:10}}>
        <div style={card}>{STR.LIG}<br/>{WEEK_SLICES_LBL[currentSlice]}</div>
        <div style={card}>{STR.PARA}<br/>12.000</div>
      </div>

      {showManager && (
        <div style={{marginTop:20, background:'#fff', color:'#2c466b', borderRadius:12, padding:16}}>
          <div style={{fontWeight:'bold', marginBottom:10}}>MENAJER</div>
          <div style={{display:'flex', gap:8, marginBottom:12}}>
            <button style={{...card, padding:'6px 12px'}} onClick={()=>setManagerTab('records')}>KAYITLAR</button>
            <button style={{...card, padding:'6px 12px'}} onClick={()=>setManagerTab('staff')}>PERSONEL</button>
          </div>
          {managerTab === 'staff' && (
            <div>
              <div style={{display:'grid', gridTemplateColumns:'repeat(4, minmax(70px,1fr))', gap:12, marginTop:8}}>
                {staffSlots.map((s, idx) => (
                  <button key={idx} onClick={()=>onStaffClick(s)} style={{border:'none', background:'transparent', cursor:'pointer'}}>
                    <div style={{width:70, height:70, borderRadius:8, background: s.filled ? '#e6f4e6' : '#d9d9d9', display:'flex', alignItems:'center', justifyContent:'center', boxShadow:'0 1px 4px rgba(0,0,0,0.06)'}}>
                      <span style={{fontSize:'1.8em'}}>{s.filled ? (s.emoji || '*') : '*'}</span>
                    </div>
                    <div style={{fontSize:'0.9em', marginTop:4, color:'#333'}}>{s.role}</div>
                  </button>
                ))}
              </div>
            </div>
          )}
        </div>
      )}

      {showInfo && (
        <div style={{position:'fixed', inset:0, background:'rgba(0,0,0,0.3)', display:'flex', alignItems:'center', justifyContent:'center'}} onClick={()=>setShowInfo(null)}>
          <div style={{background:'#fff', color:'#2c466b', borderRadius:12, padding:16, minWidth:300}} onClick={(e)=>e.stopPropagation()}>
            <div style={{fontWeight:'bold', marginBottom:6}}>{showInfo.title}</div>
            <div style={{marginBottom:10, color:'#333'}}>{showInfo.message}</div>
            <div style={{textAlign:'right'}}>
              <button style={{...card, padding:'6px 12px'}} onClick={()=>setShowInfo(null)}>{STR.GERI}</button>
            </div>
          </div>
        </div>
      )}
    </div>
  );
}
